import { Container, Row, Col, Button } from 'react-bootstrap';
import './TodoList.css';
import TodoItem from '../TodoItem/TodoItem';

function TodoList() {
    return (
        <Container fluid>
            <Row>
                <Col>
                    <div className='main'>
                        <Button varient='primary' size='sm'>click me</Button>
                    </div>
                </Col>
            </Row>
        </Container>
    );
}

export default TodoList;
